import React from "react";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function Playlist(props) {
  let [genres, setGenres] = useState([""]);

  const options = {
    method: 'GET',
    url: 'https://deezerdevs-deezer.p.rapidapi.com/genre/%7Bid%7D',
    headers: {
      'x-rapidapi-key': '20753d7e71mshfd030d40fb91b7dp123e76jsndadbb462c9f2',
      'x-rapidapi-host': 'deezerdevs-deezer.p.rapidapi.com'
    }
  };

  axios.request(options).then(function (response) {
      console.log(response.data);
  }).catch(function (error) {
      console.error(error);
  });

  return (
    <div>
      <h1>Step 3: Playlist</h1>
      <form name="cars" id="cars" multiple>
        <ul className="multiple-choice">
          <h3>
            Now that you've got your itinerary, what vibe are you going for?
          </h3>

          <div>
            <input type="radio" value="A" />
            <label>Party</label>
          </div>

          <div>
            <input type="radio" value="B" />
            <label>Relaxing</label>
          </div>

          <div>
            <input type="radio" value="C" />
            <label>Wholesome</label>
          </div>

          <div>
            <input type="radio" value="D" />
            <label>Introspective</label>
          </div>
        </ul>
      </form>
      <Link to="/myexperience">
        <button>Final: Trip Experience</button>
      </Link>
    </div>
  );
}

export default Playlist;
